import { useEffect, useState } from 'react';
import Style from "./HomeMain.module.css";
import Members from "../../../footer/footer";
import Logo from "../../../logo/mainLogo";
import SearchBar from "./searchBar";

import LeftPage from "../leftInner/page";
import LeftPageList from "../leftInner/pageList";
import LeftChat from "../leftInner/chat";
import LeftNewPost from "../leftInner/newPost";
import LeftSetting from "../leftInner/setting";

import RightNewPost from "../rightInner/newPost";
import RightChat from "../rightInner/chat";
import RightNotice from "../rightInner/notice";
import RightFriend from "../rightInner/friend";
import RightSetting from "../rightInner/setting";

const Home = ({ logout }) => {
  //가능한 값: newPost // chat // notice // friend // setting
  const [rightBookState, setRightBookState] = useState("friend");
  //가능한 값: page(글) // pageList //chat // newPost // setting
  const [leftBookState, setLeftBookState] = useState("page");

  //우측 태그 클릭 hander
  const tagClickHandler = (event) =>{
    event.preventDefault();
    setRightBookState(event.target.id);
  }

  const getToken = () => {
    const cookies = Object.Entries(
      document.cookie.split(';').map((cookie) => cookie.trim().split('=')),
    );
    console.log(cookies);
  }
  useEffect(getToken, []);

  return(
    <div className={Style.pageCover}>
      <div />
      <div className={Style.mainPage}>
        <div className={Style.bookCover}>
          <div className={Style.leftBook}>
            <div className={Style.splitBookCover}>
              <div className={Style.leftHeader}>
                <div className={Style.leftHeaderCover}>
                    <Logo />
                    <div />
                    <SearchBar />
                </div>
              </div>
              <div className={Style.leftMain}>
                {leftBookState === "page" ? <LeftPage /> : null}
                {leftBookState === "pageList" ? <LeftPageList /> : null}
                {leftBookState === "chat" ? <LeftChat /> : null}
                {leftBookState === "newPast" ? <LeftNewPost /> : null}
                {leftBookState === "setting" ? <LeftSetting /> : null}
              </div>
            </div>
          </div>
          <div className={Style.leftRightGap} />
          <div className={Style.rightBook}>
            <div className={Style.splitBookCover}>
              <div className={Style.rightHeader}>
                <div className={Style.rightHeaderCover}>
                  <div className={Style.tag}>
                    {
                      rightBookState === "newPost" ?
                      <div className={Style.activeTag} onClick={tagClickHandler} id="newPost" >
                        <p id="newPost">글</p>
                      </div>
                      :
                      <div className={Style.inactiveTag} onClick={tagClickHandler} id="newPost">
                        <p id="newPost">글</p>
                      </div>
                    }
                  </div>
                  <div className={Style.tag}>
                    {
                      (rightBookState === "chat") ?
                      <div className={Style.activeTag} onClick={tagClickHandler} id="chat">
                        <p id="chat">챗</p>
                      </div>
                      :
                      <div className={Style.inactiveTag} onClick={tagClickHandler} id="chat">
                        <p id="chat">챗</p>
                      </div>
                    }
                  </div>
                  <div className={Style.tag}>
                    {
                      (rightBookState === "notice") ?
                      <div className={Style.activeTag} onClick={tagClickHandler} id="notice">
                        <p id="notice">알</p>
                      </div>
                      :
                      <div className={Style.inactiveTag} onClick={tagClickHandler} id="notice">
                        <p id="notice">알</p>
                      </div>
                    }
                  </div>
                  <div className={Style.tag}>
                    {
                      (rightBookState === "friend") ?
                      <div className={Style.activeTag} onClick={tagClickHandler} id="friend">
                        <p id="friend">친</p>
                      </div>
                      :
                      <div className={Style.inactiveTag} onClick={tagClickHandler} id="friend">
                        <p id="friend">친</p>
                      </div>
                    }
                  </div>
                  <div className={Style.tag}>
                    {
                      (rightBookState === "setting") ?
                      <div className={Style.activeTag} onClick={tagClickHandler} id="setting">
                        <p id="setting">설</p>
                      </div>
                      :
                      <div className={Style.inactiveTag} onClick={tagClickHandler} id="setting">
                        <p id="setting">설</p>
                      </div>
                    }
                  </div>
                </div>
              </div>
              <div className={Style.rightMain}>
                { rightBookState === "newPost" ? <RightNewPost /> :  null}
                { rightBookState === "chat" ? <RightChat /> : null}
                { rightBookState === "notice" ? <RightNotice /> : null}
                { rightBookState === "friend" ? <RightFriend /> : null}
                { rightBookState === "setting" ? <RightSetting /> : null}
              </div>
            </div>
          </div>
        </div>
      </div>
      <div />
      <Members />
    </div>
  );
}
  
export default Home;
